 Priority=\"65\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" Name=\"Medium List 1 Accent 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"66\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" Name=\"Medium List 2 Accent 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"67\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" Name=\"Medium Grid 1 Accent 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"68\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" Name=\"Medium Grid 2 Accent 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"69\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" Name=\"Medium Grid 3 Accent 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"70\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" Name=\"Dark List Accent 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"71\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" Name=\"Colorful Shading Accent 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"72\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" Name=\"Colorful List Accent 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"73\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" ></w:LsdException>\r\n</w:LatentStyles>\r\n</xml><![endif]-->  <!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:\"Table Normal\";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-parent:\"\";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.0pt;\r\nfont-family:\"Times New Roman\";}\r\n</style>\r\n<![endif]-->    <!--StartFragment-->\r\n</p><p class=\"MsoNormal\"><span style=\"font-family:Tahoma;\r\nmso-bidi-font-family:Tahoma\">REGISTRATION  Please enter the basic requested information, read the Terms and Privacy information, and check the box indicating your agreement to these terms. Then, You will receive an email from SeemyTag.com. Just click on the link to confirm your registration and you will be redirected to the Site. If you do not see the email in your inbox, please check your spam/junk mailbox.</span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;\r\nmso-bidi-font-family:Tahoma\">ABOUT YOUR PERSONAL TAG - Click on the tab Tags, then click on Personal. Now you can create a personal tag about yourself that will follow the tags that you create for others to see. Promote yourself so that others will know who you are by your tag, also, if you have a favorite YouTube video, you can embed it onto your tag and it goes where you go.</span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\"></span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">Tags are easy to create, pick a background from the menu we provide, or open the Store, or upload your own background from your desktop. <o:p></o:p></span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\"></span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">The tag ATTENTION line is the largest of the three available message lines and also contains the shortest number of characters (12). There is a line above the ATTENTION line where you can make a comment (up to 50 characters in length.) And, a message line below the ATTENTION line that will accommodate up to (200) characters. Select a contrasting color for the characters used in each message line from the respective color picker and type your message.<o:p></o:p></span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\"></span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">As you can see from the carousel examples, your finished tag will resemble an auto license plate, with an abbreviated ATTENTION message and a couple of short statements (Above and below) expressing yourself.This is what its all about, a chance to express yourself.</span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\"></span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">Dont forget to embed your favorite YouTube video about you or whatever you want your tag to display. (Coming soon You will be able to upload video from your device).</span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\"></span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">When you have finished creating your tag, click on Preview or Publish, if you dont like what you see, then click on Change, and after you have made the changes, click on publish. When published you will see a pop up window that indicates tag was successfully published.</span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\"></span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">You may change any and all the tags anytime for any reason. <o:p></o:p></span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\"></span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">You can have as many personal tags as you wish, one for each area of your life. So we made it easy for you to keep up with several personal tags. This way you do not always have to keep changing up your one tag. When you have created multiple personal tags, you can choose which personal tag you want to follow the tag you create to send to others.</span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;\r\nmso-bidi-font-family:Tahoma\">YOUR BUSINESS CARD -When you register with SeemyTag.com, the information you provide will create One generic SeemyTag Social Media Marketing business card for you. This business card will follow your personal tag wherever you go. As with personal tags, you may also have multiple business cards. </span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">It is easy to create your very own custom business card with your very own logo and information about you and your company. When you have multiple business entities, you can choose which card follows which personal tag you choose. Remember each general tag you create and send will have a personal tag follow it.</span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;\r\nmso-bidi-font-family:Tahoma\">CREATING GENERAL TAGS - You may create as many general tags as you wish and send to as many as you want. You just click on the Pencil Icon in the menu bar and start Tagging! Follow the same steps as in making your personal tag.</span><o:p></o:p></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;\r\nmso-bidi-font-family:Tahoma\">SENDING THE TAG - Click on the Mail Icon and start sending. ENJOY! Its fun and a relaxing way to communicate with your friends, relatives, customers, and/or associates.</span><o:p></o:p></p>\r\n<!--EndFragment--><p></p>', '', '2013-04-24 13:39:03', 'es');
